import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './Navigation.css';
import bannerImage from '../assets/dd.jpg'; // Import the image

const Navigation = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Add your logout logic here
    navigate('/'); // Navigate back to sign-up page
  };

  return (
    <>
      <nav className="navbar">
        <div className="nav-left">
          <button className="back-button" onClick={() => navigate(-1)}>â€¹</button>
          <ul className="nav-links">
            <li><a href="#clothes">Clothes</a></li>
            <li><a href="#gadgets">Gadgets</a></li>
            <li><a href="#new">New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button" onClick={handleLogout}><FaUser /></button>
        </div>
      </nav>

      {/* Image below the navigation */}
      <div className="nav-image-container">
        <img 
          src={bannerImage} 
          alt="TechSell Banner" 
          className="nav-banner"
        />
      </div>
    </>
  );
};

export default Navigation;
